def factorials(n):
    if n <= 1:
        return n
    else:
        return n*factorials(n-1)

def evaluate_expression(x):
    if x > 10:
        return 10*x
    else:
        return x*x

def calculate(x):
    if x > 10:
        return evaluate_expression(x)
    else:
        return x*x

def calculate_area_circle(radius):
    pi = 3.14159265359
    area = pi * radius ** 2
    return area

def calculate_area_square(width):
    area = width ** 2
    return area

def calculate_area_rectangle(length, width):
    area = length * width
    return area

def multiply(a, b):
